<?php
$abs= "data:image/png;base64,";




function base64_to_jpeg($img1, $output_file) {
    
    $ifp = fopen( $output_file, 'wb' );  // open a new file , if not it will create one.

    // split the string on commas
    // $data[ 0 ] == "data:image/png;base64"  - to be used for extension
    // // $data[ 1 ] == <actual base64 string>
    $data = explode( ',', $img1 );
    

    // we could add validation here with ensuring count( $data ) > 1
    fwrite( $ifp, base64_decode( $data[1] ) );

    // clean up the file resource
    fclose( $ifp ); 
    

}
$picname = "vik".time().".png";

base64_to_jpeg($abs,$picname);


